import React, { useState } from 'react'

export default function Form() {

    const [input, setInput] = useState({
        name: '',
        diffculty: '',
        duration: '',
        season: ''
    });






  return (
    <div>
        <form>
            <input type='text' name='name' value={input.name}></input>
            <input type='text' name='diffculty' value={input.diffculty}></input>
            <input type='text' name='duration' value={input.duration}></input>
            <input type='text' name='season' value={input.season}></input>
            <button type='submit'>Submit</button>
        </form>
    </div>
  )
};
